SELECT
	j.niin as input_niin,
	n.niin as ds05_niin,
	i.niin as ds02_niin,
	i.rep_itm_ind
FROM
	tempdb..jsscheck j
	LEFT JOIN ds05_niin n ON j.niin = n.niin
	LEFT JOIN ds02_invdata i ON j.niin = i.niin
WHERE
	n.rep_itm_ind  = 'Y'


